import React from 'react';

const Footer = () => {
    const footerStyle = {
        backgroundColor: '#f8f9fa', // Color de fondo del footer
        color: '#6c757d',          // Color del texto
        textAlign: 'center',       // Alineación del texto
        padding: '20px 0',         // Padding para darle espacio
        position: 'relative',      // Posición relativa
        bottom: 0,                 // Asegura que se mantenga al fondo
        width: '100%',             // Ancho completo
    };

    return (
        <footer style={footerStyle}>
            <div>
                <p>&copy; {new Date().getFullYear()} ICD. Todos los derechos reservados.</p>
                {/* Puedes agregar más contenido aquí, como enlaces o información adicional */}
            </div>
        </footer>
    );
};

export default Footer;
